var vertexShaderSource_1 =

       `attribute vec3 a_coords;
        attribute vec3 a_colors;
        attribute vec3 a_normal;
		attribute vec2 a_texCoords;
		 varying vec2 v_texCoords;

          uniform mat4 u_T;
	      uniform mat4 u_Rx;
	      uniform mat4 u_Ry;
		  uniform mat4 u_Rz;
		  uniform float u_scale;
		  uniform mat4 u_Basis;
	      uniform mat4 u_Eye;
	      
		  uniform mat4 u_Pers;

        varying vec3 v_normal;
        varying vec3 v_coords;
        varying vec3 v_color;

        void main() {

    				mat4 M = u_T*u_Ry*u_Rx;
					mat4 V = u_Basis*u_Eye*u_Rz;
    				mat4 P = u_Pers;
    				mat4 MVP = P*V*M;
		        gl_Position = MVP*vec4(a_coords*u_scale, 1.0);
                vec3 eyeNorm = mat3(V*M) * a_normal;
                v_normal = normalize(eyeNorm);
		        v_color = a_colors;
                v_coords = a_coords;
				v_texCoords = a_texCoords;
        }`;


var fragmentShaderSource_1 =

       `precision mediump float;
        uniform vec3 u_LightColor;
        uniform vec3 u_LightPosition;
        uniform vec3 u_AmbientLight;
		uniform sampler2D u_sampler_texture;
        varying vec2 v_texCoords;

        varying vec3 v_normal;
        varying vec3 v_coords;
        varying vec3 v_color;

        void main() {
          vec3 normal = normalize(v_normal);
          vec3 lightDirection = normalize(u_LightPosition - v_coords);
          float nDotL = max(dot(lightDirection, normal), 0.0);
          
          vec3 diffuse = u_LightColor * vec3(0.0,0.0,1.0) * nDotL;
          vec3 ambient = u_AmbientLight * vec3(0.0,0.0,1.0);
		  
		  gl_FragColor = vec4(diffuse + ambient, 1.0);
        }`;

function createProgram(gl, vertexShaderSource, fragmentShaderSource) {
  var vsh = gl.createShader( gl.VERTEX_SHADER );
  gl.shaderSource( vsh, vertexShaderSource );
  gl.compileShader( vsh );

  var fsh = gl.createShader( gl.FRAGMENT_SHADER );
  gl.shaderSource( fsh, fragmentShaderSource );
  gl.compileShader( fsh );

  var prog = gl.createProgram();
  gl.attachShader( prog, vsh );
  gl.attachShader( prog, fsh );
  gl.linkProgram( prog );

  return prog;
}

function scaleperclick(gl){
gl.clearColor(0.0,0.0,0.0,1);
    
    gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
	scale = scale-0.2;
	if (scale<0.4)
	{
	scale=1;
	}
	gl.uniform1f(u_scale_location,scale);
	gl.drawArrays(gl.TRIANGLES, 0, 3*3978);
}

function clickpressed(gl){
gl.clearColor(0.0,0.0,0.0,1);
    
    gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
	scale = scale+0.2;
	if (scale>1)
	{
	scale=0.4;
	}
	gl.uniform1f(u_scale_location,scale);
	gl.drawArrays(gl.TRIANGLES, 0, 3*3978);
}

 function check(e) {
    var code = e.keyCode;
    switch (code) {
        case 37: rotateXwithLight(gl); break; //Left 
        case 38: rotateYwithLight(gl); break; //Up 
        case 39: cameraRotateZwithLight(gl); break; //Right 
        case 40:rotateinvYwithLight(gl); break;
		case 79: scaleperclick(gl);break;
        case 82: initGL_2();break;//draw red car
	    case 66: initGL_1();break;
        default: alert(code); //Everything else
    }
}

function init() {
    var canvas = document.getElementById("webglcanvas");
    gl = canvas.getContext("webgl");
 
    initGL_1();
	window.addEventListener('keydown',this.check,false);
	canvas.onmousedown=function (ev){
	clickpressed(gl);
  }

	
}

init();
